import React from "react";
import logo from "./logo.svg";
import "./App.css";
import AppRouter from "./server/Router/AppRouter";
import { BrowserRouter, Route, Link } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="user/:id">User</Link>

        <AppRouter />
      </BrowserRouter>
    </div>
  );
}

export default App;
